import React from "react";
import Menu from "./Menu";
import Footer from "./Footer";
import Form from "./Form";
import DataItems from "./DataItems";



const App =()=>{

    const Add_btn = ()=> {
        alert("")
    }

return(
    <>
    <Menu/>
    <Form
    passNote={Add_btn} />
    <DataItems />
    <Footer/>
    </>
)
}

export default App;
